import React from 'react';
import classes from './MyPosts.module.css';

const MyPosts = () => {
    return <div>My posts
      <div>New posts</div>
      <div>
        <div className={classes.item}>post 1</div>
        <div className={classes.item}>post 2</div>
        <div className={classes.item}>post 3</div>
      </div>
    </div>
}

export default MyPosts;
